import React from 'react'
import { useEffect, useState} from 'react';


function Profile({profileID}) {
    const [profiles, setProfiles] = useState([])
    console.log(profileID)
    const API = `http://localhost:3000/profiles/${profileID}`
    useEffect(() => {
      async function fetchProducts(){
        const result = await fetch(API);
        const items = await result.json();
        setProfiles(items)
      }
      fetchProducts()

    }, [])
    console.log(profiles)

    return (
        <div className="profilePage">
            <h1>Profile</h1>
            <hr/>
            <br/>
            <img className="profileImage" src={profile.profile_picture} alt={profiles.name}/>
            <br/><br/>
            <h3>User{profile.user_id}</h3>
            <hr/>
            <h3 className="profileDetails">Location:</h3><h3> {profiles.location}</h3>
            <h3 className="profileDetails">About: </h3><h3> {profiles.bio}</h3>
            <h3 className="profileDetails">Gender: </h3><h3> {profiles.gender}</h3>
            <hr/>
            <br/>
        </div>
    )
}

export default Profile
